import React, { Component } from "react";
import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import {
	Portlet,
	PortletHeader,
	PortletLabel,
	PortletToolbar,
	PortletContent,
	PortletFooter
} from "components";
import { withStyles } from "@material-ui/styles";
import styles from "./styles";

class Team extends Component {
	constructor(props) {
		super(props);
		this.state = {};
	}

	render() {
		return (
			<div className={this.props.classes.root}>
				<Grid container spacing={2}>
					<Typography variant="h2">Team Members :</Typography>
					{this.props.teamMembers.map(teamMember => {
						return (
							<Grid item md={6}>
								<Portlet className={classes.portlet}>
									<PortletContent>
										<Typography
											variant="h3"
											className={classes.title}
											color="textPrimary"
											gutterBottom>
											{classroom.name}
										</Typography>
										<Typography
											variant="h4"
											className={classes.subtitle}
											color="textPrimary"
											gutterBottom>
											{classroom.cousrename}
										</Typography>
									</PortletContent>
									<PortletFooter />
								</Portlet>
							</Grid>
						);
					})}
				</Grid>
				<br />
				<Grid container spacing={2}>
					<Typography variant="h2">Team Members :</Typography>
					{this.props.teamMembers.map(teamMember => {
						return (
							<Grid item md={6}>
								<Portlet className={classes.portlet}>
									<PortletContent>
										<Typography
											variant="h3"
											className={classes.title}
											color="textPrimary"
											gutterBottom>
											{classroom.name}
										</Typography>
										<Typography
											variant="h4"
											className={classes.subtitle}
											color="textPrimary"
											gutterBottom>
											{classroom.cousrename}
										</Typography>
									</PortletContent>
									<PortletFooter />
								</Portlet>
							</Grid>
						);
					})}
				</Grid>
			</div>
		);
	}
}

export default withStyles(styles)(Team);
